import React from 'react';
import './App.css';
import {Link} from'react-router-dom';

function Nav(){

    const navStyle ={
        color: 'white'
    };
    return(
        <nav>
            <img src=" \src\images\SS.png" width="10" height="10"></img>
            <ul className="nav-links">
                <Link style={navStyle} to = '/about'>
                    <li>About</li>
                </Link>
                <Link style={navStyle} to ='Shop'>
                    <li> Shop</li>
                </Link>
                
            </ul>
        </nav>
    )
}

export default Nav;
